import React, { useState } from 'react'

const ListJ = () => {
    const [myusers,setmyuser]=useState([
        {name:"avigail"},
        {name:"noemi"}
    ])
  return <>{myusers.map(l=>{<p key={l.name}>{l.name}</p>})}</>
  
}

export default ListJ
